import React from 'react';
import Nav from 'react-bootstrap/Nav';
import {Link} from 'react-router-dom';

import './Navbar.css';

const Navbar = () => {

    return(
        <Nav className='navbar'></Nav>
    );
}

Navbar.defaultProps = {
    title: 'movieDB',
};

export default Navbar;
